import React from 'react';
import './../css/App.css';
import Header from './Header';
import SearchForm from './SearchForm';
function App() {
  return (
    <div>
      <Header/>
      <div className="main">
        <div className="container">
          <div className="row">
            <SearchForm/>
          </div> 
        </div>
    </div>
    </div>
  );
}

export default App;
